  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, pH, alkalinity,
  temperature, salinity and other variables collected from discrete sample and profile
  observations using CTD, bottle and other instruments from the THOMAS G. THOMPSON
  in the South Pacific Ocean from 1994-01-25 to 1994-02-19 (NODC Accession 0115762)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-27T02:00:12.926813\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro8e9c6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115762 includes chemical,
  discrete sample, physical and profile data collected from THOMAS G. THOMPSON in
  the South Pacific Ocean from 1994-01-25 to 1994-02-19. These data include ALKALINITY,
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Christopher D. Winn of Hawaii Pacific University as part of the WOCE_P31 data set.nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"license_title\":
